import apartments from "../../datas/Apartments.json"
import Card from "../Card/Card"
function Carrousel (){
return (
    <div>
        {apartments.map((apart, id) => (
            <div
            key={`${apart.title}-${id}`}
            picture={apart.cover}
            title={apart.title}

            />
        ))}
    </div>
)
}

export default Carrousel
